import React from "react";


export default class JugadoresPagina extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      jugador: [],
    };
  }

  componentDidMount() {
    fetch("https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040")
      .then((res) => res.json())
      .then((data) => {
        this.setState({
          jugador: data.player,
        });
      })
      .catch((err) => console.log(err));
  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col">
            <section class="header-liga">
              <div class="container justify-content-center align-items-center">
                <div class="row justify-content-between">
                  <div class="col-lg-3 d-flex flex-row justify-content-center align-items-center">
                    <div class="header-left">
                      <p class="text"> Jugadores </p>
                    </div>
                  </div>
                  <div class="col-lg-3 mx-5">
                    <div class="header">
                      <p class="text"> Real Madrid </p>
                    </div>
                  </div>
                </div>
              </div>
            </section>
            <table className="table table-striped">
              <thead>
                <tr>
                  <th scope="col">Nombre</th>
                  <th scope="col">Posicion</th>
                  <th scope="col">Fecha de Nacimiento</th>
                  <th scope="col">Nacionalidad</th>
                </tr>
              </thead>
              <tbody>
                {this.state.jugador.map((jugador) => (
                  <tr>
                    <td>{jugador.strPlayer}</td>
                    <td>{jugador.strPosition}</td>
                    <td>{jugador.dateBorn}</td>
                    <td>{jugador.strNationality}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    );
  }
}
